import React from 'react';
import Login from './Login';
import { BrowserRouter, Route, Routes } from 'react-router-dom'

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Login />} />
        </Routes>
      </BrowserRouter>
      <h1>Jarvis Automotive Services</h1>
      <Login />
    </>
  )
}

export default App;
